import React from "react";

function FormComponent(props){
  return (
    <main>
      <form>
        <input
          type="radio"
          name="training"
          checked={props.data.sessionType ===  "training"}
          onChange={props.handleChange}
        /> Training
        <br />
        <input
          type="radio"
          name="climbing"
          checked={props.data.sessionType ===  "climbing"}
          onChange={props.handleChange}
        /> Climbing
        <br />
        <input
          type="radio"
          name="indoor"
          //checked={placeholder}
          //onChange={[placeholder]}
        /> Indoor
        <br />
        <input
          type="radio"
          name="outdoor"
          //checked={placeholder}
          //onChange={[placeholder]}
        /> Outdoor
        <br />
        <input
          type="checkbox"
          name="boulder"
          //checked={placeholder}
          //onChange={[placeholder]}
        /> Bouldering
        <br />
        <input
          type="checkbox"
          name="toprope"
          //checked={placeholder}
          //onChange={[placeholder]}
        /> Top Rope
        <br />
        <input
          type="checkbox"
          name="lead"
          //checked={placeholder}
          //onChange={[placeholder]}
        /> Lead
        <br />
        <input
          type="checkbox"
          name="trad"
          //checked={placeholder}
          //onChange={[placeholder]}
        /> Trad
        <br />
      </form>
    </main>
  )
}

export default FormComponent
